import React from "react";
import Login from '../Components/Login/Index';
import Test from '../Components/Index';
const routes = [
    {
        path:"/",
        exact:"true",
        main:()=><Login />
    },
    {
        path:"/test",
        exact:"true",
        main:()=><Test />
    }
];
export default routes;
